import React from 'react';
import Icon from './Icon';

const Login = () => {
    return (
        <div className="login-wrapper custom-border-right">
            <Icon 
                className='fas fa-user-alt'
            />
            <span>
                Login / Register
            </span>
        </div>
    );
}

export default Login;
